import React from "react";
import Typewriter from "typewriter-effect";

function TypeWriter() {
  return (
    <Typewriter
      options={{
        strings: [
          "Front End Developer (React/ HTML-CSS-JS) ",
          "Back End Developer (Java/Python)",
          "Mobile Developer (Flutter/XML)",

        ],
        autoStart: true,
        loop: true,
        deleteSpeed: 50,
      }}
    />
  );
}

export default TypeWriter;
